package validator

import (
	"fmt"
	"github.com/libsv/go-bt/v2"
	"strings"
	"testing"

	"github.com/stretchr/testify/assert"
)

type args struct {
	tx          *bt.Tx
	blockHeight uint32
}

var policy = NewPolicySettings()

// 9a87105441107db10d3e4cf2146022f754241b3b93c39539e2ce882a398e7d69
var largeTx, _ = bt.NewTxFromString("")

var txTests = []struct {
	name    string
	args    args
	wantErr assert.ErrorAssertionFunc
}{
	{
		name: "TestTxValidator_checkScripts - empty Tx",
		args: args{
			tx:          bt.NewTx(),
			blockHeight: 0,
		},
		wantErr: assert.NoError,
	},
	{
		name: "TestTxValidator_checkScripts - empty Tx",
		args: args{
			tx:          largeTx,
			blockHeight: 720000,
		},
		wantErr: assert.NoError,
	},
}

func TestTxValidator_checkScripts(t *testing.T) {
	for _, tt := range txTests {
		t.Run(tt.name, func(t *testing.T) {
			tv := &TxValidator{
				policy: policy,
			}
			tt.wantErr(t, tv.checkScripts(tt.args.tx, tt.args.blockHeight), fmt.Sprintf("checkScriptsWithSDK(%v, %v)", tt.args.tx, tt.args.blockHeight))
		})
	}
}

func TestTxValidator_checkScriptsWithSDK(t *testing.T) {
	for _, tt := range txTests {
		name := strings.Replace(tt.name, "checkScripts", "checkScriptsWithSDK", 1)
		t.Run(name, func(t *testing.T) {
			tv := &TxValidator{
				policy: policy,
			}
			tt.wantErr(t, tv.checkScriptsWithSDK(tt.args.tx, tt.args.blockHeight), fmt.Sprintf("checkScriptsWithSDK(%v, %v)", tt.args.tx, tt.args.blockHeight))
		})
	}
}

func TestGoBt2GoSDKTransaction(t *testing.T) {
	t.Run("TestGoBt2GoSDKTransaction", func(t *testing.T) {
		txBytes := largeTx.Bytes()
		sdkTx := GoBt2GoSDKTransaction(largeTx)

		assert.Equal(t, largeTx.TxID(), sdkTx.TxID())
		assert.Equal(t, txBytes, sdkTx.Bytes())
	})
}
